create table states
(
    id           serial,
    name         varchar,
    country_id   integer,
    country_code varchar,
    fips_code    varchar,
    iso2         varchar,
    type         varchar,
    latitude     numeric(10, 8) default NULL::numeric,
    longitude    numeric(11, 8) default NULL::numeric
);

alter table states
    owner to hotel_checker;

